#include <iostream>
#include <vector>
#include <map>

using namespace std;

template<typename K, typename V>
class interval_map {
	friend void IntervalMapTest();
public:
	V m_valBegin;
	std::map<K,V> m_map;
	// constructor associates whole range of K with val
	interval_map(V const& val)
	: m_valBegin(val)
	{}

	interval_map(V const& val, map<K,V> mp)
	: m_valBegin(val), m_map(mp)
	{}

	// Assign value val to interval [keyBegin, keyEnd).
	// Overwrite previous values in this interval.
	// Conforming to the C++ Standard Library conventions, the interval
	// includes keyBegin, but excludes keyEnd.
	// If !( keyBegin < keyEnd ), this designates an empty interval,
	// and assign must do nothing.
	void assign( K const& keyBegin, K const& keyEnd, V const& val ) {
		if(!(keyBegin < keyEnd)){
			return;
		}

		V tmp = m_valBegin;

		auto aux = m_map.upper_bound(keyBegin);

		for(auto it = aux; it != m_map.end();){
			if(it->first >= keyEnd) break;
			tmp = it->second;
			auto delVal = it;
			it = next(it);
			m_map.erase(delVal);
		}

		if(m_map.empty() and val == m_valBegin) return;

		m_map[keyBegin] = val;
		m_map[keyEnd] = tmp;

	}

	// look-up of the value associated with key
	V const& operator[]( K const& key ) const {
		auto it=m_map.upper_bound(key);
		if(it==m_map.begin()) {
			return m_valBegin;
		} else {
			return (--it)->second;
		}
	}
};

template<typename K, typename V>
struct Assign {
	K const& keyBegin;
	K const& keyEnd;
	V const& val;
};

template<typename K, typename V>
struct Test {
    interval_map<K, V> input;
	Assign<K, V> assign;
	interval_map<K, V> output;
};

template<typename K, typename V>
bool AreEqual(interval_map<K,V> A, interval_map<K,V> B){
	if(A.m_valBegin != B.m_valBegin) return false;
	if(A.m_map.size() != B.m_map.size()) return false;

	for (auto it = A.m_map.begin(); it != A.m_map.end(); ++it) {
        auto found = B.m_map.find(it->first);
        if (found == B.m_map.end() || found->second != it->second) {
            return false;
        }
    }

	return true;
}

template<typename K, typename V>
void printMap(map<K,V> mp){
	for(auto x: mp){
		cout << "{ " << x.first << " , " << x.second << " } | ";
	}
	cout << endl;
}
int main() {

	vector<Test<int,char>> input = {
		{
			input: {'0'},
			assign: {
				keyBegin: 0,
				keyEnd: 10,
				val: 'X'
			},
			output: {'0', {{0, 'X'}, {10, '0'}} },
		},
		{
			input: {'0', {{3, 'A'}, {10, '0'}} },
			assign: {
				keyBegin: 0,
				keyEnd: 6,
				val: 'X'
			},
			output: {'0', {{0, 'X'}, {6, 'A'}, {10, '0'}} },
		},
		{
			input: {'0', {{3, 'A'}, {10, '0'}} },
			assign: {
				keyBegin: 0,
				keyEnd: 11,
				val: '0'
			},
			output: {'0'},
		}
	};


	for(int i = 0; i < input.size(); i++){
		auto t = input[i];
		t.input.assign(t.assign.keyBegin, t.assign.keyEnd, t.assign.val);

		bool result = AreEqual(t.input, t.output);
		printf("Test #%d: %s\n", i, result ? "OK":"FAILED");
		if(!result){
			printf("Expected: ");
			printMap(t.output.m_map);
			printf("Got: ");
			printMap(t.input.m_map);
		}
	}

    return 0;
}

#include <stdio.h>

void reverse(int* arr, int n);
void swap(int* ptr1, int* ptr2);
void rev_rec(int* arr, int n);

void main()
{
	int array[] = { 1,2,3,4,5 };

	int * arr;

	arr = array;

	int i;

	printf("\nStart of program\n\n");

	printf("Array before program:\n");

	for (i = 0; i < sizeof(array) / sizeof(int); i++)
		printf("%d ", array[i]);


	//reverse( arr, sizeof(array) / sizeof(int));
	rev_rec(arr, sizeof(array) / sizeof(int));

	printf("\n\nArray after program:\n");

	for (i = 0; i < sizeof(array) / sizeof(int); i++)
		printf("%d ", array[i]);
}

void reverse(int* arr, int n)
{
	int temp, i;

	for (i = 0; i < n / 2; i++)
		swap(&arr[i], &arr[n - 1 - i]);
}

void swap(int* ptr1, int* ptr2)
{
	int temp;

	temp = *ptr1;
	*ptr1 = *ptr2;
	*ptr2 = temp;
}

void rev_rec(int* arr, int n)
{
	if (n > 1)
	{
		swap(arr, arr + n - 1);

		rev_rec(arr + 1, n - 2);
	}
}

