#include <iostream>
#include <vector>

class RungeKutta {
protected:
    double t;
    std::vector<double> Y, YY, Y1, Y2, Y3, Y4, FY;

public:
    RungeKutta(uint32_t N) {
        Init(N);
    }

    double getY(uint32_t index) {
        return Y.at(index);
    }

    void Init(uint32_t N) {
        Y.resize(N);
        YY.resize(N);
        Y1.resize(N);
        Y2.resize(N);
        Y3.resize(N);
        Y4.resize(N);
        FY.resize(N);
    }

    void SetInit(double t0, std::vector<double> Y0) {
        t = t0;
        if (Y.empty()) Init(Y0.size());
        for (size_t i = 0; i < Y.size(); i++)
            Y[i] = Y0[i];
    }

    virtual std::vector<double> F(double t, std::vector<double> Y) = 0;

    void NextStep(double dt) {
        if (dt < 0) return;

        Y1 = F(t, Y);

        for (size_t i = 0; i < Y.size(); i++)
            YY[i] = Y[i] + Y1[i] * (dt / 2.0);

        Y2 = F(t + dt / 2.0, YY);

        for (size_t i = 0; i < Y.size(); i++)
            YY[i] = Y[i] + Y2[i] * (dt / 2.0);

        Y3 = F(t + dt / 2.0, YY);

        for (size_t i = 0; i < Y.size(); i++)
            YY[i] = Y[i] + Y3[i] * dt;

        Y4 = F(t + dt, YY);

        for (size_t i = 0; i < Y.size(); i++)
            Y[i] = Y[i] + dt / 6.0 * (Y1[i] + 2.0 * Y2[i] + 2.0 * Y3[i] + Y4[i]);

        t = t + dt;
    }
};

class TA : public RungeKutta {
private:

    const double b = 0.215; // bifurcation parameter

public:
    TA(uint32_t N) : RungeKutta(N) {}

    std::vector<double> F(double t, std::vector<double> Y) override {
        // x = Y[0]; y = Y[1]; z = Y[2]
        FY[0] = sin(Y[1]) - b * Y[0];
        FY[1] = sin(Y[2]) - b * Y[1];
        FY[2] = sin(Y[0]) - b * Y[2];
        return FY;
    }

    static void Test() {
        double dt = 0.001;
        TA task(3);
        std::vector<double> Y0 = { 0, 1, 0 };
        task.SetInit(0, Y0);
        while (true) {
            std::cout << "Time = " << task.t << "; x = " << task.Y[0] << "; y = " << task.Y[1] << "; z = " << task.Y[2] << '\n' ;
            task.NextStep(dt);
        }
    }
};

