#include <iostream>

using namespace std;

int nwd(int a, int b) {
	//cout << "Wywoluje funkcje!\n";
	if (a * b == 0) return 0;		// brak wspÃ³lnego dzielnika
	if (a < 0) {
		a = -a;
	}
	if (b < 0) {
		b = -b;
	}
	while (a != b) {
		if (a > b) {
			a -= b;
		}
		if (b > a) {
			b -= a;
		}
	}
	return a;
}

int nww(int a, int b) {
	return a * b / nwd(a, b);
}

int main() {
	int a, b;
	cout << "Podaj dwie liczby calkowite: ";
	cin >> a >> b;
	auto wynik{ nwd(a, b) };
	if (wynik == 0) {
		cout << "Liczby " << a << " i " << b << " nie maja wspolnego dzielnika ani wspolnej wielokrotnosci.\n";
	}
	else {
		cout << "Najwiekszym wspolnym dzielnikiem liczb " << a << " i " << b << " jest liczba " << wynik << endl;
		cout << "Z kolei najmniejsza wspolna wielokrotnoscia tych liczb jest " << nww(a, b) << endl;
	}
	return 0;
}

