void main()
{

	int array[] = { 5,2,1,8,4 };

	int* arr, max, min, sum, isEven, n;
	double avg;

	arr = array;

	arrCalc(arr, sizeof(array)/sizeof(int), &max, &min, &sum, &avg, &isEven);
	
	printf("\n\n---START---\n");

	for (int i = 0; i < (sizeof(array)/sizeof(int)); i++)
		printf("%d, ", array[i]);

	printf("\nSizeof Array: %d\n", sizeof(array)/sizeof(int));
	printf("Max: %d\n", max);
