#include <stdio.h>
#include <stdlib.h>	// must use to use malloc or the program will crash

void inputArray(int* arr, int n);
void printArray(int* array, int n);

int main()
{
	printf("How many numbers do you want:\n");

	int input; scanf_s("%d", &input);

	if (input <= 0) {
		printf("Invalid input. Please enter a positive number.\n");
		return 1;
	}
	
	int *arr = malloc(input * sizeof(int));
	
	if (arr == NULL)
	{
		printf("Memory allocation failed.\n");
		return 1;
	}

	inputArray(arr, input);
	printArray(arr, input);

	free(arr);
	return 0;
}

void inputArray(int* arr, int n)
{
	printf("Enter %d integers\n", n);

	for (int i = 0; i < n; i++) {
		scanf_s("%d", &arr[i]);
	}
}

void printArray(int* arr, int n)
{
	printf("\nValues are: ");

	for (int i = 0; i < n; i++) {
		printf("%d%s", arr[i], (i == n - 1) ? "." : ", ");
	}

	printf("\n\n");
}
